import {Project} from "../interfaces/iProject"
import {useState} from "react"

export interface IPropsMainMenu {
    project: Project
}

export const MainMenu = (props: IPropsMainMenu) => {

    const [t2, setT2] = useState(new Date())

    setTimeout(() => {
        const now = new Date()
        console.log(now)
        setT2(now)
    }, 1000)

    return <ul>
        <li>
            {props.project.name}
        </li>
        <li>
            {t2.toLocaleTimeString()}
        </li>
        <li>Time</li>
        <li>Projects</li>
        <li>Reports</li>
    </ul>
}
